import React, { useEffect, useState } from 'react';
import { BrowserRouter as Router } from 'react-router-dom';

import FrontPage from './front_page';
import * as feartures from './features.mjs';

function App() {
  const [inputs, setinputs] = useState({
    user_cpu: '',
    user_gpu: '',
    user_ram: 0
  });
  const {user_cpu, user_gpu, user_ram} = inputs
  const onChange = e => {
    const {name, value} = e.target;
    setinputs({
      ...inputs,
      [name]: value
    });

  };


  return (
    <Router>
      <FrontPage
      user_cpu = {user_cpu}
      user_gpu = {user_gpu}
      user_ram = {user_ram}
      onChange = {onChange}
      />
    </Router>
  ) ;
}

export default App;
